import axios from "axios";
import React, { Component } from "react";

class Repos extends Component {
  constructor() {
    super();
    this.state = {
      links: [],
    };
  }
  componentDidMount = () => {
    axios.get("http://localhost:3000//repo.json").then((response) => {
      this.setState({
        links: response.data,
      });
    });
  };

  render() {
    return (
      <div>
        <hr></hr>
          <h1>repository</h1>
 {
          <ol>
            {this.state.links.map((repos, index) => {
              return (
                
                <div key={index}>
                  <Result qoute={repos} index={index} />
                </div>
              );
            })}
          </ol>
        }
      </div>
    );
  }
}

export default Repos;
